def read_tuv(path = None):
    if path is None:
        lines = defaultinput.split('\n')
    else:
        lines = file(path, 'r').read().split('\n')
    location = 'header'
    idxs = []
    jlabels = []
    values = []
    for line in lines:
        if location == 'header':
            if line.strip() == 'Photolysis rate coefficients, s-1':
                location = 'keys'
        elif location == 'keys':
            if line[:11] == 'values at z':
                location = 'between'
            else:
                idx, jlabel = map(str.strip, [line[:4], line[7:]])
                idxs.append(idx)
                jlabels.append(jlabel)
        elif location == 'between':
            if line[:21] == 'time, hrs.  sza, deg.':
                location = 'data'
        elif location == 'data':
            if line[:4] == '----':
                location = 'done'
            else:
                vals = map(float, line.split())
                values.append(vals)
    jkeys = ['hour', 'sza'] + jlabels
    formats = ['f'] * (len(idxs) + 2)
    output_keys = zeros(len(values), dtype = dtype(dict(names = jkeys, formats = formats)))
    ikeys = ['hour', 'sza'] + idxs
    output_key_translator = dict(zip(jkeys, ikeys))
    output_idxs = zeros(len(values), dtype = dtype(dict(names = ikeys, formats = formats)))
    for ri, vals in enumerate(values):
        for key, idx, value in zip(jkeys, ikeys, vals):
            output_keys[ri][key] = value
            output_idxs[ri][idx] = value
    
    return output_key_translator, output_idxs

